@Ankita Minhas it's all kinda new for me. For years I've had that memory of the lead up but never really thought too much about it. And thought it was just a weird memory. But a friend I told about it pointed some details out and when I thought about it, what she said made sense. 
I still don't have the full memory. Nor do I want to. As for the person, the parts I don't remember include his face. I just see his body. From the torso down. Although, there is a sinking feeling in my gut that I do know who it was and that it was somebody closer to me than I want to think about. So I try not to dwell on the memory too much. 

And I'm so sorry for your trauma!!! Keep holding your head up. We just have to remember we aren't to blame. And people who abuse people and then try to act like the victim or guilt us are scumbags. And Should rot in jail.

